import React, { useEffect, useState } from 'react';

function App() {
  const [stocks, setStocks] = useState([]);

  useEffect(() => {
    // Fetch the profit/loss data from the backend
    fetch('/api/profit-loss')
      .then(response => response.json())
      .then(data => setStocks(data))
      .catch(error => console.error('Error:', error));
  }, []);

  return (
    <div>
      {stocks.map(stock => (
        <div key={stock.symbol}>
          <h2>{stock.symbol}</h2>
          <p>Profit/Loss: ${stock.profit_loss.toFixed(2)}</p>
        </div>
      ))}
    </div>
  );
}

export default App;
